import React, { useState, useEffect } from 'react';

interface Order {
  price: string;
  quantity: string;
}

interface OrderbookData {
  bids: Order[];
  asks: Order[];
}

interface OrderbookProps {
  asset: string;
}

const Orderbook: React.FC<OrderbookProps> = ({ asset }) => {
  const [orderbook, setOrderbook] = useState<OrderbookData>({ bids: [], asks: [] });

  useEffect(() => {
    fetch(`/orderbook/${asset}`)
      .then(response => response.json())
      .then(data => {
        const formattedData = {
          bids: data.bids.map((bid: [string, string]) => ({ price: bid[0], quantity: bid[1] })),
          asks: data.asks.map((ask: [string, string]) => ({ price: ask[0], quantity: ask[1] })),
        };
        setOrderbook(formattedData);
      })
      .catch(error => console.error('Error fetching orderbook:', error));
  }, [asset]);

  return (
    <div className="orderbook">
      <div className="bids">
        <h3>Bids</h3>
        {orderbook.bids.map((bid, index) => (
          <div key={index}>
            <span>{bid.price}</span> <span>{bid.quantity}</span>
          </div>
        ))}
      </div>
      <div className="asks">
        <h3>Asks</h3>
        {orderbook.asks.map((ask, index) => (
          <div key={index}>
            <span>{ask.price}</span> <span>{ask.quantity}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Orderbook;
